('KEA3113', 'KEA3113', 'Maxis', 3, '1. Bil murid ramai iaitu 1250 orang tetapi penggunaan talian terhad dimana bilangan PC yg boleh digunakan secara serentak maksimum 13PC daripada 21PC+82netbook yg ada dimakmal ICT sekolah. Sekiranya penggunaan melebihi 13PC, talian internet akan menjadi lambat dan sangkut.\r\n\r\n2. Selaras dengan anjakan 7 PPPM, sekolah telah mengambil inisiatif mencipta beberapa sistem pengurusan sekolah secara online bagi memudahkan urusan pengumpulan data dan membantu pengurusan sekolah untuk membuat analisis. Tetapi memandangkan liputan talian terhad utk sesetengah lokasi sahaja (yg ada huawei B618 - tidak meliputi keseluruhan kawasan sekolah) menyebabkan emosi guru yang mengisi data dikawasan tanpa liputan talian internet terganggu. ', 3, 30, 3, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
