('ABAB026', 'ABAB026', 'Celcom', 1, 'Kelajuan internet semenjak diterima tidak memuaskan dan tidak mencapai kpi yang ditetapkan  iaitu 30 Mbps dan semakin merosot ditambah selepas  pkp. Berbagai cara dilakukan contohnya mencari signal yang paling terbaik menggunakan external antenna, namun kelajuan download dan upload berada di bawah 5 Mbps sahaja.\r\n\r\nAmat mengecewakan kerana laporan telah dibuat berulang kali setiap bulan, namun jawapan yang diterima adalah \'kawasan sekolah congested\'. Pihak celcom tidak mengendahkan rungutan dari laporan yang diterima malah memberitahu pihak mereka akan mengupgrade network\' namun tidak memberi tarikh yang spesifik.\r\n\r\nSekolah tiada pilihan lain selain terus menggunakan talian tersebut dan membayar bil tanpa mendapat perkhidmatan seperti yang dijanjikan. ', 3, 30, 1, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL),
