('mbc2067', 'MBC2067', 'TM', 4, 'Sekolah saya ada  22 kelas, pihak sekolah mengadakan perhimpunan melalui platform google meet, didapati bahawa talian tak stabil iaitu ada yang ada capaian internet dan ada yang terputus talian secara tiba-tiba, ada yang langsung tidak ada capaian, walaupun pihak sekolah telah berusaha memasang router tambahan dengan sokongan PIBG.  Ada kelas yang tidak dapat mengakses internet untuk PdPC dalam kelas. Perkhidmatan ISP Fasa Interim lebih baik daripada dulu. Sekolah saya luas dibekalkan 3 talian,tetapi 3 talian tidak cukup untuk menampung keperluan sekolah.', 1, 100, 3, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
