('cba7154', 'CBA7154', 'Celcom', 1, 'Talian tersangat bermasalah dari segi kelajuan(sangat pelahan bagaikan tidak boleh akses ada ketikanya) dan ianya terlalu kerap terjadi. Boleh dikatakan hampir setiap hari permasalah ini terjadi. Walaupun sudah melaporkan berkali-kali kepada pihak celcom careline(dah berkali-kali reset sudah hasil pun sama tidak ada perubahan). Pihak celcom bagaikan tidak dapat memberikan penyelesaian terhadap permasalah talian internet sekolah kami ini. Apatah lagi untuk menghantar pihak teknikal mereka ke sini bagi menyiasat dan menyelesaikan permasalahan yang di laporkan berkali-kali ini(tidak seperti pihak Yes YTL dulu, mereka datang dari kuala lumpur demi menyelesaikan permasalahan yang kami laporkan) sedangkan cawangan celcom temerloh ada di sini.\r\nSpeedtest ke atas ketiga-tiga peranti interim ini= download tidak sampai 3mbps pun, manakala upload 20mbps ke atas(bagaikan tidak normal akan speedtest ini dari kebiasaan iaitu download mesti lebih tinggi daripada upload). Tambahan pula ianya mempunyai data yang terhad iaitu 150GB bulanan untuk setiap peranti.\r\n Mohon  jasa baik pihak tuan/puan untuk membantu sekolah kami ini tentang akan permasalahan talian interim ini.\r\nJika keadaan ini berterusan saya percaya. Apa jua program ict yang di beri oleh KPM tidak dapat sekolah kami laksanakan seperti google classroom.', 2, 30, 3, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
